import React from "react";
import "./Bus.css";
import Moment from 'react-moment';
import moment from 'moment';

const bus = props => {
  return (
    <div className="Bus">
      <p>
        Numer autobusu: {props.routeId} Kierunek: {props.headsign}
      </p>
      Data:{moment(new Date()).format("DD/MM/YYYY")}
      Odjazd: <Moment fromNow ago>{moment(new Date()).format("DD/MM/YYYY")} {props.estimatedTime}</Moment>
    </div>
  );
};


export default bus;
